"use strict";(function(){var trees=SF.getByClass("tree-a");for(var i=trees.length;i--;){var tree=trees[i];SF.attachListener(tree,"click",function(evt){var target=evt.target||evt.srcElement;if(target.nodeName==="H2"&&!SF.classList.contains(target,"tree-a-no-sub")){SF.classList.toggle(target,"tree-a-active")}})}})();